ConstValues.value:
"mutation visitorConversationCustomDataSet($sourceVisitorId: String!, $projectId: Int!, $source: Source!, $conversationId: UUID!, $customData: [VisitorConversationCustomDataInput!]!) {
  visitorConversationCustomDataSet(sourceVisitorId: $sourceVisitorId, projectId: $projectId, source: $source, conversationId: $conversationId, customData: $customData) {
    __typename
    id
    conversationId
    customData {
      __typename
      ... on VisitorConversationCustomDataEntryInt {
        key
        intValue
      }
      ... on VisitorConversationCustomDataEntryString {
        key
        stringValue
      }
      ... on VisitorConversationCustomDataEntryFloat {
        key
        floatValue
      }
      ... on VisitorConversationCustomDataEntryBoolean {
        key
        booleanValue
      }
    }
  }
}"

"mutation visitorAuthenticateAnonymously($projectId: LegacyId!, $vuid: String) {
  visitorAuthenticateAnonymously(input: {projectId: $projectId, vuid: $vuid}) {
    __typename
