"query FetchConversationMessages($pageCount: Int!, $after: String, $input: ConversationsVisitorMessagesInput) {
  conversationsVisitorMessages(conversationsVisitorMessagesInput: $input) {
    __typename
    ongoingConversation {
      __typename
      id
    }
    messages(first: $pageCount, after: $after) {
      __typename
      pageInfo {
        __typename
        hasNextPage
        hasPreviousPage
        startCursor
        endCursor
      }
      edges {
        __typename
        cursor
        node {
          __typename
          ...ConversationMessage
        }
      }
    }
    proactiveBotMessages(first: $pageCount) {
      __typename
      pageInfo {
        __typename
        hasNextPage
        hasPreviousPage
        startCursor
        endCursor
      }
      edges {
        __typename
        cursor
        node {
          __typename
          ...ConversationMessage
        }
      }
    }
  }
}"
